CREATE DEFINER=`id17974059_llamacielovuorix`@`%` PROCEDURE `verPresentacionDetalle` (IN `IDpresentacion` INT)  BEGIN
    select
        liquidacion_ID as ID_liq,
        donadores.donador_nombre as nombre,
        presentaciones.liquidacion_donador_dni as dni,
        tarjetas.tarjeta_descripcion as tarjeta,
        presentaciones.liquidacion_donador_tarjetanumero as tarjetaNro,
        presentaciones.liquidacion_donador_importe as importe,
        presentaciones.liquidacion_fechaDesde as desde,
        presentaciones.liquidacion_fechaHasta as hasta
    from 
    	presentaciones
    	inner join donadores on
    	presentaciones.liquidacion_donador_id = donadores.donador_id
    		inner join tarjetas on
    		presentaciones.liquidacion_donador_tarjetaTipo = tarjetas.tarjeta_id
    where 
    	presentaciones.liquidacion_id = IDpresentacion
    order by 
    	donadores.donador_nombre;
END$$

CREATE DEFINER=`id17974059_llamacielovuorix`@`%` PROCEDURE `verPresentaciones` (IN `IDtarjeta` TINYINT)  BEGIN
    select
    
        liquidacion_ID as ID_liq,
        tarjetas.tarjeta_descripcion as tarjeta,
        presentaciones.liquidacion_fechaDesde as desde,
        presentaciones.liquidacion_fechaHasta as hasta
    from 
    	presentaciones
    		inner join tarjetas on
    		presentaciones.liquidacion_donador_tarjetaTipo = tarjetas.tarjeta_id
    where
    	presentaciones.liquidacion_id <> 0 and
    	presentaciones.liquidacion_donador_tarjetaTipo = IDtarjeta
    group by
    	liquidacion_ID,
        tarjetas.tarjeta_descripcion,
        presentaciones.liquidacion_fechaDesde,
        presentaciones.liquidacion_fechaHasta
    order by 
    	presentaciones.liquidacion_fechaDesde,
        presentaciones.liquidacion_fechaHasta;
END$$

